  array('meta_id' => '2110','post_id' => '1047','meta_key' => '_wp_attached_file','meta_value' => '2011/03/Design_BobbyBishop.jpg'),
  array('meta_id' => '269','post_id' => '61','meta_key' => 'Solution','meta_value' => '"Everyday Man" was an album for the people, directly addressing the kids and gang-related activity in his neighborhood in Lynn, MA.  With that in mind, Bobby wanted to make sure that the album cover reflected the gritty \'everyday-ness\' of Lynn.  Bobby and his photographer went around snapping shots of Bobby in and around Lynn then sent them to me for compositing.  Almost all of the pictures you see in the composition are from Lynn, from Bobby\'s brown house and favorite diner on the right to the \'Do Not Enter\' sign from his block on the left, to the paper airplanes with Bobby\'s lyrics written on them.  The "Everyday Man" album cover truly reflects the everyday atmosphere of Bobby\'s hometown.  Overall, this project was a blast to work on, and Bobby was thrilled with the outcome which was my goal from the very start! '),
  array('meta_id' => '270','post_id' => '63','meta_key' => 'Scope','meta_value' => '<span>Album Cover Design & Layout
</span>'),
  array('meta_id' => '271','post_id' => '63','meta_key' => 'Project','meta_value' => 'Extra Gems Vol. II'),
