  array('meta_id' => '276','post_id' => '63','meta_key' => 'Client Location','meta_value' => 'Detroit, MI (USA)'),
  array('meta_id' => '647','post_id' => '210','meta_key' => '_wp_attached_file','meta_value' => '2011/03/Design_ExtramGems.jpg'),
  array('meta_id' => '651','post_id' => '63','meta_key' => 'Solution','meta_value' => 'Utilizing some promo photos he\'d sent me earlier that year, I chose a photo that looked like he was grasping a rare gem in his hands (yes, he already had a photo like that, Othello is a NUT).  I decided to make the cover look like an old heist movie poster, with Othello as the mastermind of the heist stealing the jewels.  I topped it off with small details like the Detroit skyline silhouetted in the back and the track listings in the style of movie credits at the bottom.  All-in-all, it came out looking great!  Othello loved it the first time he saw it, and I was thankful for him giving me creative freedom to deliver something fresh and visually stunning for his project.'),
