  array('meta_id' => '2120','post_id' => '1048','meta_key' => 'Solution','meta_value' => 'Kambui is a very versatile artist, mixing a very organic personality with a soulful mix of sounds.  To reflect this, I wanted to give him a visual representation of his versatile musical talent and decided to go with a composite of all the instruments Kambui plays, mixed with a natural ambiance, sprinkled with some elements that represent the spiritual aspect of his music.  Kambui loved the outcome and loved it even more when he saw how the look could be applied to the other visual collateral of the project.  In the end, I was able to deliver Kambui with an effective visual package that made he was proud to share with everyone at his album release party.  '),
