  array('meta_id' => '2144','post_id' => '1054','meta_key' => 'Solution','meta_value' => 'At the time, I\'d had this vision of a floating musical island in mind, a gritty, organic, urban island with mechanical gears exposed through the roots and dirt.  I wanted it to look like the island had been freshly uprooted, and put some speakers in the island for everyone underneath back on earth to hear.  In the end, Larry was thrilled with the outcome and walked away a happy, satisfied "customer".'),
