  array('meta_id' => '2854','post_id' => '1386','meta_key' => 'Solution','meta_value' => 'For his new album, Gino wanted something totally different from the branding and look we had come up with for his first album.  So I decided to take The Chemo Kid brand in a more mature direction, with clean typography and solid colors.  Since the new album was titled "The Chemical Chronicles", chronicling Gino\'s day-to-day fight with cancer, he wanted something that referenced the warning labels on the prescription drug bottles he was so familiar with.'),
