  array('meta_id' => '3192','post_id' => '1524','meta_key' => 'Solution','meta_value' => 'Teaming up with the creative forces behind LL3Dsn, we landed on going with something iconic in the world of rock-&-roll - the coveted magazine cover.  In addition to the magazine cover idea, we also came up with some styles that had more of a Hard Rock Cafe feel to them, something we could see people grabbing on the way out of a Rock-N-Roll Wine event.  Being based in Las Vegas, this idea went over really well with the owners.'),
