  array('meta_id' => '3232','post_id' => '1539','meta_key' => 'Solution','meta_value' => 'The solution seems simple, but designing for yourself, as a designer, is probably one of the hardest things you\'ll ever have to do in your career.  Because as an artist you have so many varied interests in different artistic styles and layouts, it\'s easier to focus on a certain style for a client\'s project than choosing which style best represents you.  Especially for me - if you look at my portfolio, you see that I enjoy many different styles of art, my style is "no style".  So for me, the best solution was to just do what felt right, and that\'s what I did!'),
