  array('meta_id' => '3254','post_id' => '1546','meta_key' => 'Solution','meta_value' => 'For every PocketLabWorks project, the solution is the same: give Kevin a clean UI for him to program and for his customers to enjoy.  Since the UI is usually very simple and straight-forward, I usually get to add the real flare to the app through the branding and aesthetic design.  You can view some screenshots of the various app designs above, or check out the full line at <a href="http://pocketlabworks.com">www.pocketlabworks.com</a>.'),
