  array('meta_id' => '3270','post_id' => '1549','meta_key' => 'Solution','meta_value' => 'For this project, I found it best to simply build upon what Brandon and his developer and cohort, Brian, had already laid out.  The interface was simple to both use and understand, and that was most important to us - making sure users would be able to pick up the app and run with it.  Therefore, I simply focused on aesthetic details to make sure the identity of the app design matched the branding.'),
