  array('meta_id' => '4038','post_id' => '788','meta_key' => 'Solution','meta_value' => 'Wanting to improve upon the initial design we created for T10 two years ago, and with the addition of being able to play T10 online via Silverlight, we decided to amp up the design and really emphasize the importance of playing the game.  The solution was simple - improve the aesthetic of the design and the UI to make it more geared towards online gameplay and setting things up for future capabilities such as online multiplayer.'),
