  array('meta_id' => '4082','post_id' => '1974','meta_key' => 'Solution','meta_value' => 'The challenge was to create a website that was unique from other sites that dealt with coupon creation.  This was achieved with a combination of a unique color palette and simple, intuitive UI.  The guys at Gtown also wanted some infographics included to help educate their customers on consumer habits and coupon-related statistics.  We built the infographic design into the vertical flow of the website design, using the dotted line motif from coupons as the cue for users to follow along to receive the information.  In the end, the guys were very satisfied with their design and are currently working with their programmer to make it functional.  Full site will be up soon.'),
